import React from 'react';
import { Typography, Button, ButtonGroup, Container, TextField} from '@mui/material';
import AcUnitOutlinedIcon from '@mui/icons-material/AcUnitOutlined';
import SendIcon from '@mui/icons-material/Send';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';

const useStyles = styled(TextField)({

    marginTop: 20,
    marginButtom: 20,
    display: 'block',
    color: 'error'

});

export default function Create() {
  return (
    <Container>
      <Typography 
        variant='h4'
        gutterBottom
      > Create a New Node: </Typography> 

      <form noValidate autoComplete="off">

      <TextField 
      classes = {useStyles.TextField}
      label="Note Title" variant="outlined" color = "error" fullWidth required/>
      <br /> <br />

     <TextField 
      classes = {useStyles.TextField}
      label="Deatails" variant="outlined" gutterBottom color = "error" fullWidth required/>

      <Button 
      type='Submit' 
      color='secondary' 
      variant='contained'


      >SUMBIT</Button>

      </form>
    </Container>
  );
}
